  <style>
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
      font-size: 96.66% !important;
      line-height: 145.46% !important;
    }

    ul {
      list-style-type: none
    }

    img {
      max-width: 100%
    }

    body {
      font-family: Arial, sans-serif;
      font-size: 13px;
      background: #050505;
      color: #f4f4f4;
      margin: 0 auto;
      padding-bottom: 60px;
      max-width: 600px
    }

    .header {
      background: #1a1a1a;
      width: 100%;
      margin: 0 auto
    }

    .header__wrapper {
      height: 48px;
      position: relative;
      display: flex;
      justify-content: center;
      align-items: center
    }

    .header__logo svg {
      width: 170px
    }

    .header__menu {
      position: absolute;
      top: 50%;
      transform: translateY(-50%);
      left: 0;
      margin: 0 10px;
      display: flex;
      flex-direction: column;
      gap: 8px;
      width: 24px
    }

    .header__menu span {
      width: 100%;
      background: #fff;
      height: 2px
    }

    .nav__list {
      display: flex
    }

    .nav__item {
      display: flex;
      align-items: center;
      justify-content: center;
      gap: 5px;
      background-color: #151515;
      text-align: center;
      border: 1px solid #444;
      flex: 1 1 auto;
      height: 30px;
      font-size: 11px
    }

    .header__tags-wrapper {
      padding: 15px 10px;
      max-width: 100%;
      overflow-x: auto;
      display: flex;
      gap: 10px;
      scrollbar-width: thin;
      scrollbar-color: transparent transparent
    }

    .header__tags-wrapper::-webkit-scrollbar {
      width: 0;
      height: 0
    }

    .header__tags-item {
      flex: 0 0 auto;
      height: 30px;
      border: 1px solid #505050;
      border-radius: 3px;
      display: flex;
      align-items: center;
      justify-content: center;
      padding: 0 20px
    }

    .main {
      padding: 0 5px
    }

    .main__title {
      margin: 20px 0;
      padding: 0 5px;
      font-weight: 600;
      font-size: 15px
    }

    .main__wrapper {
      display: flex;
      flex-wrap: wrap;
      gap: 15px 10px
    }

    .main__item {
      width: calc(50% - 5px)
    }

    .main__item .item__image {
      width: 100%;
      position: relative;
      margin-bottom: 5px
    }

    .main__item .item__image:before {
      content: '';
      background: -moz-linear-gradient(to bottom, rgba(0, 0, 0, 0), rgba(0, 0, 0, .7));
      background: -webkit-linear-gradient(to bottom, rgba(0, 0, 0, 0), rgba(0, 0, 0, .7));
